import React from 'react'

const Suggestions = (props) => {
  const options = props.results.map(r => (
    <option id={r.id} key={r.id}>
      {`${r.first_name} ${r.last_name}`}
    </option>
  ))
  return <form onSubmit={props.submit}>{options}</form>
}

export default Suggestions
